import React, { Component } from 'react'

import '../../../src/styles.css'

import { StyledContainer, CardContainer, CardDiv } from './styled'

export default class CategoryCards extends Component {
  render() {
    return (
      <StyledContainer>
        <CardContainer>
          <CardDiv></CardDiv>
          <CardDiv></CardDiv>
          <CardDiv></CardDiv>
          <CardDiv></CardDiv>
        </CardContainer>
      </StyledContainer>
    )
  }
}
